import {motion, useTransform, useScroll} from 'framer-motion';
import {useRef} from 'react';

function useParallax(value, distance) {
    return useTransform(value, [0, 1], [-distance, distance]);
  }

const Content = () => {
    // const work = useRef(null);
    // const {scrollYProgress} = useScroll({taget: work});
    // const y = useParallax(scrollYProgress, 300);

    const work = useRef(null);
    const { scrollYProgress } = useScroll({ target: work });
    const y = useParallax(scrollYProgress, 300);
    return (
        <section id="academics" className='relative h-[100vh] snap-center flex flex-col justify-center items-center px-8'>
            <div className='w-full h-[25%] flex flex-row justify-center text-center'>
                <div className='w-[49%] h-full flex flex-col justify-center items-center text-right px-4'>
                    <span className='w-full '>August 2022 - Present</span>
                </div>
                <div className='w-[10%] h-full flex flex-col '></div>
                <div className=' w-[5%] h-full  flex flex-col items-center text-center'>
                    <span className='w-[0%] border h-full'></span>
                    <span className='w-full border rounded-full p-2 '><i className='fa fa-graduation-cap'></i></span>
                    <span className='w-[0%] border h-full'></span>
                </div>
                <div className='w-[10%] h-fit flex flex-col '></div>
                <div className='w-[49%] h-full border flex flex-col rounded-xl text-left px-4 py-4'>
                    <div className='border-b flex flex-col'>
                        <span className='text-lg font-bold'>Binghamton University</span>
                        <span>Master's in Computer Science</span>
                    </div>
                    <ul className='pt-2 font-light'>
                        <li>Data structres and algorithms</li>
                        <li>Utilized tools like GitHub, VSCode, Docker</li>
                    </ul>
                </div>
            </div>
            {/* 2nd div */}
            <div className=' w-full h-[25%] flex flex-row justify-center text-center'>
                <div className='w-[49%] h-full border flex flex-col text-right rounded-xl px-4 py-4'>
                    <div className='border-b flex flex-col'>
                        <span className='text-lg font-bold'>VR Siddhartha Engineering College</span>
                        <span>Bachelor's in Computer Science</span>
                    </div>
                    <ul className='pt-2 font-light'>
                        <li>Operating Systems</li>
                        <li>Utilized tools like GitHub, VSCode, Docker</li>
                    </ul>
                </div>
                <div className='w-[10%] h-full flex flex-col '></div>
                <div className=' w-[5%] h-full flex flex-col items-center text-center'>
                    <span className='w-[0%] border h-full'></span>
                    <span className='w-full border rounded-full p-2 '><i className='fa fa-graduation-cap'></i></span>
                    <span className='w-[0%] border h-full'></span>
                </div>
                <div className='w-[10%] h-fit flex flex-col '>
                    <span className='w-full border-b-0'></span>
                    <span className='w-full '></span>
                </div>
                <div className='w-[49%] h-full flex flex-col justify-center rounded-lg text-left px-4'>
                    <span className=''>August 2022 - Present</span>
                </div>
            </div>
            {/* 3rd div */}
            <div className=' w-full h-[25%] flex flex-row justify-center text-center pb-0'>
                <div className='w-[49%] h-full flex flex-col justify-center items-center text-right px-4'>
                    <span className='w-full '>August 2022 - Present</span>
                </div>
                <div className='w-[10%] h-full flex flex-col '></div>
                <div className=' w-[5%] h-full flex flex-col items-center text-center'>
                    <span className='w-[0%] border h-full'></span>
                    <span className='w-full border rounded-full p-2 '><i className='fa fa-briefcase'></i></span>
                    <span className='w-[0%] border h-full'></span>
                </div>
                <div className='w-[10%] h-fit flex flex-col '>
                    <span className='w-full border-b-0'></span>
                    <span className='w-full '></span>
                </div>
                    <div className=' relative w-[49%] h-full border flex flex-col text-right rounded-xl px-4 py-4'>
                        <fieldset className='w-full h-full'>
                            <legend className='border rotate-45'></legend>
                            <div className='border-b flex flex-col'>
                                <span className='text-lg font-bold'>VR Siddhartha Engineering College</span>
                                <span>Bachelor's in Computer Science</span>
                            </div>
                            <ul className='pt-2 font-light'>
                                <li>Operating Systems</li>
                                <li>Utilized tools like GitHub, VSCode, Docker</li>
                            </ul>
                        </fieldset>
                    </div>
            </div>

        </section>
    )
}

const Workex = () => {
    return (
        <Content />
    )
}

export default Workex;




